local function ragdoll(c, t)
	local hum = c:FindFirstChildOfClass("Humanoid")

	local cs = Instance.new("Folder")
	cs.Name = "ColliderFolder"
	cs.Parent = c

	hum.PlatformStand = true

	for _,v in pairs(c:GetDescendants()) do
		if v:IsA("Motor6D") or v:IsA("Motor") then
			local bcs = Instance.new("BallSocketConstraint")
			bcs.Name = "RagdollSocket"
			bcs.Parent = v.Part0

			v.Part1.CanCollide = false
			v.Part0.CanCollide = false
			v.Part1.CollisionGroup = "Players"

			local fake = Instance.new("Part")
			fake.Massless = true
			fake.Transparency = 1
			fake.Name = v.Part1.Name
			fake.Size = v.Part1.Size / 1.1
			fake.CollisionGroup = "Colliders"
			-- // fake.Shape = Enum.PartType.Ball

			fake.Parent = cs

			local w = Instance.new("Weld")
			w.Part0 = v.Part1
			w.Part1 = fake
			w.Parent = fake

			local a0 = Instance.new("Attachment")
			a0.Name = "RagdollAttachment"
			a0.Parent = v.Part0

			local a1 = Instance.new("Attachment")
			a1.Name = "RagdollAttachment"
			a1.Parent = v.Part1

			a1.Position = v.C1.Position
			a0.WorldPosition = a1.WorldPosition

			bcs.LimitsEnabled = true

			bcs.Attachment0 = a0
			bcs.Attachment1 = a1

			if v.C0.Position == v.C1.Position then
				v.Enabled = true
			else
				v.Enabled = false
			end

			coroutine.wrap(function()
				if t ~= nil and tonumber(t) ~= nil then
					task.wait(t)
					hum.PlatformStand = false

					fake:Destroy()
					v.Enabled = true
				end
			end)()
		end
	end
end

