-- // functions

local rnd = Random.new()

local function change(ws, jh)
	raga.Humanoid.WalkSpeed = ws or raga:GetAttribute("OWS")
	raga.Humanoid.JumpHeight = jh or raga:GetAttribute("OJH")
end

local function nn(mn, mx, int)
	if int then
		return rnd:NextInteger(mn, mx)
	else
		return rnd:NextNumber(mn, mx)
	end
end

local function findhum(p)
	local mdl = p:FindFirstAncestorOfClass("Model")

	if mdl then
		return mdl:FindFirstChildOfClass("Humanoid")
	end
end

local function get_hums(pos, rad)
	local hums = {}
	local gotten = {}

	for _, v in pairs(workspace:GetPartBoundsInRadius(pos, rad)) do
		local hum = findhum(v)

		if hum and not gotten[hum] then
			gotten[hum] = true
			table.insert(hums, hum:FindFirstAncestorOfClass("Model"))
		end
	end

	return hums
end

local function hb(pt, cf, size, type, bl)
	local params = OverlapParams.new()
	params.FilterType = Enum.RaycastFilterType.Exclude
	params.FilterDescendantsInstances = {script, bl, char}

	if dbg then
		local p = Instance.new("Part")
		p.Size = size
		p.Anchored = true
		p.CanTouch = false
		p.CanQuery = false
		p.CanCollide = false
		p.CastShadow = false
		p.CFrame = pt.CFrame * cf
		p.Color = Color3.new(1, 0, 0)
		p.Material = Enum.Material.ForceField

		if type == "Magnitude" then
			p.Shape = "Ball"
		end

		p.Parent = script
		task.delay(.5, p.Destroy, p)
	end

	local victims = {}
	local ncf = (pt.CFrame * cf)
	local tbl = workspace:GetPartBoundsInBox(pt.CFrame * cf, size, params)

	for _, hit in pairs(tbl) do
		if type == "Magnitude" and (hit.Position - ncf.Position).Magnitude > (size.X / 2) then
			continue
		end

		local hum = findhum(hit)

		if hum and hum.RootPart and hum.Health > 0 then
			if not table.find(victims, hit:FindFirstAncestorOfClass("Model")) then
				table.insert(victims, hit:FindFirstAncestorOfClass("Model"))
			end
		end
	end

	table.sort(victims, function(a, b)
		return (raga.Humanoid.RootPart.Position - a.HumanoidRootPart.Position).Magnitude < (raga.Humanoid.RootPart.Position - b.HumanoidRootPart.Position).Magnitude
	end)

	return victims
end

local function stun(hum, t)
	if not t or t <= 0 then
		return
	end

	coroutine.wrap(function()
		local data = stuns[hum]

		if data then
			if data[3] > t and (tick() + t) - (data[3] + data[4]) < 0 then
				return
			else
				data[1]:Disconnect()
				task.cancel(data[2])
			end
		end

		local mdl = hum:FindFirstAncestorOfClass("Model")

		local ows = hum:GetAttribute("OWS") or raga.Humanoid.WalkSpeed
		hum:SetAttribute("OWS", ows)
		raga.Humanoid.WalkSpeed = .5

		mdl:SetAttribute("Stunned", true)

		coroutine.wrap(function()
			local cnt = mdl.DescendantAdded:Connect(function()
				hum:UnequipTools()
			end)

			local thread = task.delay(t, function()
				mdl:SetAttribute("Stunned", false)

				raga.Humanoid.WalkSpeed = ows
				stuns[hum][1]:Disconnect()
			end)

			stuns[hum] = {cnt, thread, t, tick()}
		end)()
	end)()
end

local function rocky(args)
	assert(args.Origin, "No origin data.")

	local orig = args.Origin
	local amt = args.Amount or 30
	local life = args.Lifetime or 3
	local radius = args.Radius or 20
	local delay = args.DelayAmount or .05
	local size = args.Size or Vector3.one * 2

	local a, b = 30, 360 / amt

	if typeof(orig) == "Instance" then
		orig = orig.CFrame
	end

	orig *= (args.Offset or CFrame.new())

	local params = RaycastParams.new()
	params.FilterType = Enum.RaycastFilterType.Exclude
	params.FilterDescendantsInstances = {script, args.Exclude, char}

	local rocks = Instance.new("Model")
	rocks.Name = "Rocks"
	rocks.Parent = script

	if args.AttachTo then
		args.BypassDuration = true

		args.AttachTo.Destroying:Connect(function()
			rocks:Destroy()
		end)
	end

	if not args.BypassDuration then
		task.delay(life + delay * amt + .5, rocks.Destroy, rocks)
	end

	for _ = 1, amt do
		local r1 = workspace:Raycast(
			(orig * CFrame.Angles(0, math.rad(a), 0) * CFrame.new(radius / 2 + radius / 2.7, 10, 0)).Position,
			Vector3.yAxis * -20,
			params
		)

		local r2 = workspace:Raycast(
			(orig * CFrame.Angles(0, math.rad(a), 0) * CFrame.new(radius / 2 + radius / 10, 10, 0)).Position,
			Vector3.yAxis * -20,
			params
		)

		if r1 and r2 then
			local rock = Instance.new("Part")
			rock.Anchored = true
			rock.CanCollide = false
			rock.CanQuery = false
			rock.CanTouch = false
			rock.Material = r1.Material
			rock.Color = r1.Instance.Color
			rock.TopSurface = Enum.SurfaceType.Smooth
			rock.BottomSurface = Enum.SurfaceType.Smooth

			rock.Size = Vector3.new(size.X * 1.3, size.Y / 1.4, size.Z * 1.3) * nn(1, 1.5)

			rock.CFrame = CFrame.new(
				r1.Position - (Vector3.yAxis / 2),
				orig.Position
			) * CFrame.Angles(
				nn(-.25, .5), nn(-.25, .25), nn(-.25, .25)
			)

			for _, v in pairs(r1.Instance:GetChildren()) do
				if v:IsA("Texture") then
					for _, face in pairs(Enum.NormalId:GetEnumItems()) do
						local txt = v:Clone()
						txt.Face = face
						txt.Parent = rock
					end
				end
			end

			local stone = rock:Clone()
			stone.Size = Vector3.new(rock.Size.X * 1.01, rock.Size.Y * .25, rock.Size.Z * 1.01)
			stone.CFrame = rock.CFrame * CFrame.new(0, rock.Size.Y / 2 - stone.Size.Y / 2.1, 0)

			local rubble = rock:Clone()
			rubble.CFrame = CFrame.new(
				r2.Position - (Vector3.yAxis * size * .4),
				orig.Position
			) * CFrame.Angles(
				nn(-1, -.3), nn(-.15, .15), nn(-.15, .15)
			)

			local pebble = stone:Clone()
			pebble.CFrame = rubble.CFrame * CFrame.new(0, rubble.Size.Y / 2 - pebble.Size.Y / 2.1, 0)

			rock.Parent = rocks
			stone.Parent = rocks
			rubble.Parent = rocks
			pebble.Parent = rocks

			if not args.BypassDuration then
				task.delay(life + 1 * delay, function()
					for _, v in pairs(rocks:GetChildren()) do
						tw:Create(
							v,
							TweenInfo.new(1),
							{
								Size = Vector3.zero,
								Position = v.CFrame.Position - Vector3.yAxis * (v.Size.Y + 2)
							}
						):Play()
					end
				end)
			end
		end

		a += b
	end
end

local function scale_pe(pe, scale)
	local old = pe.Parent

	local mdl = Instance.new("Model")
	pe.Parent = mdl
	mdl:ScaleTo(scale)

	pe.Parent = old
	mdl:Destroy()
end

local function change_lifetime(pe, scale)
	for _, v in pairs(pe:GetDescendants()) do
		if v:IsA("ParticleEmitter") then
			v.Lifetime = NumberRange.new(v.Lifetime.Min * scale, v.Lifetime.Max * scale)
		end
	end
end

local function play_pe(fx)
	for _, v in pairs(fx:GetDescendants()) do
		if v:IsA("ParticleEmitter") then
			v.Enabled = false
			task.delay(v:GetAttribute("EmitDelay") or 0, v.Emit, v, v:GetAttribute("EmitCount"))
		end
	end
end

local function create_fx(t, victim, ep, scale)
	if typeof(ep) ~= "CFrame" then
		ep = ep or victim.HumanoidRootPart
	else
		local oep = ep

		ep = Instance.new("Part", script)
		ep.Anchored = true
		ep.Transparency = 1
		ep.CanCollide = false
		ep.CanQuery = false
		ep.CanTouch = false
		ep.CFrame = oep

		task.delay(3, ep.Destroy, ep)
	end

	if not t then
		return
	end

	local lookup = {
		Blunt = assets.Effects.Attacks.BluntHit,
		Slash = assets.Effects.Attacks.SlashHit,
		DivinePunch = assets.Effects.Attacks.Punch,
		DivineAirland = assets.Effects.Attacks.Land2,
		DivineAirblast = assets.Effects.Attacks.Fire,
		WorldCuttingWind = assets.Effects.Attacks.Wind,
		SilaTerrainSmack = assets.Effects.Attacks.Smack,
		SilaTerrainStomp = assets.Effects.Attacks.Stomp,
		WorldCuttingThrow = assets.Effects.Attacks.Throw,
	}

	local fx = lookup[t]:Clone()

	if scale then
		scale_pe(fx, scale)
	end

	fx.Parent = ep
	fx.CanCollide = false
	fx.CanQuery = false
	fx.CanTouch = false
	fx.Anchored = true
	fx.Massless = true
	fx.CFrame = ep.CFrame
	play_pe(fx)

	task.delay(5, fx.Destroy, fx)

	return fx
end

local function attack(tbl, stats, ep)
	local victims = tbl

	if #(victims) ~= 0 then
		local snd = stats.Sound

		if stats.Sound then
			if typeof(stats.Sound) == "table" then
				snd = stats.Sound[nn(1, #(stats.Sound), true)]
			end
		end

		play(snd, victims[1]:FindFirstChild("HumanoidRootPart"))
	end

	local dmg = stats.Damage or 0

	for _, victim in pairs(victims) do
		coroutine.wrap(function()
			local thum, hrp = victim:FindFirstChildWhichIsA("Humanoid"), victim:FindFirstChild("HumanoidRootPart")

			if thum.Health - dmg <= 0 and stats.DoNotKill then
				thum.Health = .01
			else
				thum.Health -= dmg
			end

			stun(thum, stats.Stun)

			if stats.Ragdoll then
				coroutine.wrap(ragdoll)(victim, stats.Ragdoll)
			end

			if stats.Knockback then
				local bv = Instance.new("BodyVelocity", hrp)
				bv.MaxForce = Vector3.one * 10000000
				bv.Velocity = raga.Humanoid.RootPart.CFrame.LookVector * stats.Knockback[1] + (stats.Knockback[3] or Vector3.zero)

				task.delay(stats.Knockback[2], bv.Destroy, bv)
			end

			create_fx(stats.HitEffect, victim, ep)
		end)()
	end
end

local function linger(n, stats, dmg_stats, w)
	local bl = {}

	if #(stats) == 3 then
		table.insert(stats, "Box")
	end

	table.insert(stats, bl)

	task.spawn(function()
		for _ = 1, n do
			local inhb = hb(unpack(stats))

			for _, v in pairs(inhb) do
				table.insert(bl, v)
			end

			attack(inhb, dmg_stats)

			if w then
				task.wait(w)
			else
				task.wait()
				task.wait()
			end
		end
	end)
end

local function create_cd(name)
	local rname = name

	if name == "RushFinish" then
		rname = "RushAttack"
	end

	if not no_cd then
		task.wait(cds[name])
	end

	dbs[rname] = false
end

