local function rush_attack()
	if dbs.RushAttack or dbs.Stunned then
		return
	end

	change(8, 0)
	dbs.Stunned = true
	dbs.RushAttack = true

	play(`LMB{cds.RushCount}SFX`)

	local anim = anims[`LMB{cds.RushCount}`]
	anim:AdjustWeight(3.5 + (cds.RushCount / 10))
	anim.Stall = .1
	anim:Play()

	if trail_thread and cds.RushCount ~= 2 then
		task.cancel(trail_thread)
	end

	trail_thread = task.spawn(function()
		for _, v in pairs(raga.TrailParent.Value:GetChildren()) do
			if v:IsA("Trail") then
				v.Enabled = true
			end
		end

		task.wait(.6)

		for _, v in pairs(raga.TrailParent.Value:GetChildren()) do
			if v:IsA("Trail") then
				v.Enabled = false
			end
		end
	end)

	local hbx = {raga.Humanoid.RootPart, CFrame.new(0, -5, -6), Vector3.new(8, 12, 12)}

	if cds.RushCount == 4 then
		cds.RushCount = 1
		task.delay(.3, linger, 5, hbx, stats.RushFinish)

		task.delay(.6, function()
			dbs.Stunned = false
			change()
		end)

		create_cd("RushFinish")
	else
		cds.RushCount += 1

		local stat = table.clone(stats.RushAttack)
		stat.Sound = `LMB{cds.RushCount - 1}HFX`
		stat.HitEffect = ((cds.RushCount - 1) == 2 and "Blunt" or "Slash")

		task.delay(.3, linger, 5, hbx, stat)

		coroutine.wrap(function()
			local clmb = cds.RushCount
			task.wait(cds.RushFinish / 2 + .4)

			if cds.RushCount == clmb then
				cds.RushCount = 1
			end
		end)()

		create_cd("RushAttack")
		dbs.Stunned = false
		change()
	end
end

local function divine_airblast()
	if dbs.DivineAirblast or dbs.Stunned then
		return
	end

	change(8, 0)
	dbs.Stunned = true
	dbs.DivineAirblast = true

	play("DivineAirblast")
	anims.DivineAirblast:Play()
	anims.DivineAirblast:GetMarkerReachedSignal("Hitbox"):Wait()

