	local x, y, z = (CFrame.new(fx.Position, result) * CFrame.Angles(0, 0, math.pi / 2)):ToEulerAnglesXYZ()

	tw:Create(fx, TweenInfo.new(.2, Enum.EasingStyle.Linear), {CFrame = CFrame.new(result) * CFrame.Angles(x, y, z)}):Play()

	local bl = {}
	local s = tick()

	repeat
