				bv.MaxForce = Vector3.one * 10e7
				bv.Velocity = (hrp.Position - fx.Position).Unit * 50 + Vector3.yAxis * 25
				bv.Parent = hrp

				task.delay(.2, bv.Destroy, bv)
			end

			task.wait()
