local function terrain_toss()
	if dbs.TerrainToss or dbs.Stunned then
		return
	end

	local params = RaycastParams.new()
	params.FilterDescendantsInstances = {script, char}
	params.FilterType = Enum.RaycastFilterType.Exclude

	local floor = workspace:Raycast(raga.Humanoid.RootPart.Position, Vector3.yAxis * -16, params)

	if not floor then
		return
	end

	floor = floor.Instance

	change(0, 0)
	dbs.Stunned = true
	dbs.TerrainToss = true
	raga.Humanoid.AutoRotate = false

	local hit = mhit

	local bg = Instance.new("BodyGyro")
	bg.P = 1e5
	bg.MaxTorque = Vector3.yAxis * 10e7
	bg.CFrame = CFrame.new(raga.Humanoid.RootPart.Position, hit)
	bg.Parent = raga.Humanoid.RootPart

	play("TerrainToss")
	anims.TerrainToss:Play()
	task.wait(.3)

	local cf = raga.Humanoid.RootPart.CFrame * CFrame.new(-.5, raga.Humanoid.RootPart.Size.Y * -3.5, -4)

	coroutine.wrap(rocky)({
		Radius = 6,
		Amount = 12,
		Origin = cf,
		Size = Vector3.new(1, 1.5, 1)
	})

	for _, plr in pairs(game:GetService("Players"):GetPlayers()) do
		if plr and plr.Character and plr.Character:FindFirstChild("HumanoidRootPart") and (plr.Character.HumanoidRootPart.Position - raga.Humanoid.RootPart.Position).Magnitude <= 24 then
			cam_shake(plr, "Bump")
		end
	end

	local fx = create_fx("SilaTerrainStomp", nil, cf)
	change_lifetime(fx, 1.5)

	local rock = assets.Effects.Attacks.RockProjectile:Clone()
	rock.Parent = script
	rock.Anchored = false
	rock.Color = floor.Color
	rock.Material = floor.Material
	rock.AlignPosition.RigidityEnabled = true
	rock.Position = fx.Position - Vector3.yAxis * 12
	rock.AlignPosition.Attachment1 = raga.Humanoid.RootPart:FindFirstChild("Bone.033", true)

	local txts = {}

	for _, v in pairs(floor:GetChildren()) do
		if v:IsA("Decal") or v:IsA("Texture") then
			v:Clone().Parent = rock
			table.insert(txts, v)
		end
	end

	local s = tick()

	while tick() - s < .5 do
		task.wait()
		hit = mhit
		bg.CFrame = CFrame.new(raga.Humanoid.RootPart.Position, hit)
