			p.CFrame = raga.Humanoid.RootPart.CFrame * CFrame.new(((i - (amt / 2)) / (amt / 2)) * 64, nn(-3, 64), p.Size.Z / -2 + 4) * CFrame.Angles(math.rad(nn(-15, 15)), 0, math.rad(nn(-180, 180)))
			p.Parent = mdl
			tw:Create(p, TweenInfo.new(.5), {Transparency = 1}):Play()

			table.insert(fakes, p)
		end

		task.delay(.5, h.Destroy, h)

		mdl.Parent = script

		if raga.Humanoid.FloorMaterial ~= Enum.Material.Air then
			local debris = assets.Effects.WorldSlash.Debris:Clone()
			debris.Parent = script
			debris:SetPrimaryPartCFrame(raga.Humanoid.RootPart.CFrame * CFrame.new(0, -500, -12) * CFrame.Angles(0, math.pi / 2, 0))

			local params = RaycastParams.new()
			params.FilterDescendantsInstances = {script, char}
			params.FilterType = Enum.RaycastFilterType.Exclude

			task.spawn(function()
				for i = 1, 90, 10 do
					for j = 0, 9 do
						local p = debris:FindFirstChild(tostring(i + j))
						local goal = p.Position + Vector3.yAxis * 485
						local result = workspace:Raycast(goal + Vector3.yAxis * 50, Vector3.yAxis * -256, params)

						if result then
							local result = result.Instance
							p.Color = result.Color
							p.Material = result.Material

							for _, v in pairs(result:GetChildren()) do
								if v:IsA("Decal") or v:IsA("Texture") then
									v:Clone().Parent = p
								end
							end

							tw:Create(p, TweenInfo.new(.15), {Position = goal}):Play()

							task.delay(3, function()
								tw:Create(p, TweenInfo.new(2), {Position = p.Position - Vector3.yAxis * p.Size.Y * 2}):Play()
							end)
						else
							p:Destroy()
						end
					end

					task.wait()
					task.wait()
					task.wait()
				end
			end)

			task.delay(5, debris.Destroy, debris)
		end

		local params = OverlapParams.new()
		params.FilterType = Enum.RaycastFilterType.Exclude
		params.FilterDescendantsInstances = {script, workspace:FindFirstChild("Base"), char}

		local dismantle = true
		local cf, size = mdl:GetBoundingBox()

		local options = {
			SplitApart = true,
			CollisionFidelity = Enum.CollisionFidelity.Default,
			RenderFidelity = Enum.RenderFidelity.Performance
		}

		local coptions = {
			tolerance = 1,
			weldConstraintPreserve = Enum.WeldConstraintPreserve.All
		}

		local main = hum.RootPart.Position

		for _, v in pairs(workspace:GetPartBoundsInBox(cf, size, params)) do
			if not v:IsA("MeshPart") and v.Name:lower() ~= "baseplate" and v.Name:lower() ~= "base" then
				if dismantle and not findhum(v) then
					local params = OverlapParams.new()
					params.FilterDescendantsInstances = fakes
					params.FilterType = Enum.RaycastFilterType.Include

					local stuffs = workspace:GetPartsInPart(v, params)

					if #(stuffs) < 1 then
						v.Anchored = false
						continue
					end

					local msh = v:FindFirstChildOfClass("SpecialMesh")

					if msh then
						msh:Destroy()
					end

					task.spawn(function()
						local success, parts = pcall(function()
							return gs:SubtractAsync(v, stuffs, options)
						end)

						if success and parts and #(parts) > 1 then
							for _, p in pairs(parts) do
								p.Anchored = false
								p.CFrame = p.CFrame
								p.UsePartColor = true

								local bv = Instance.new("BodyVelocity", p)
								bv.MaxForce = Vector3.one * 10e7
								bv.Velocity = (p.Position - main).Unit * nn(250, 750, true)
								task.delay(.1, bv.Destroy, bv)

								p.Parent = v.Parent
							end

							local consts = gs:CalculateConstraintsToPreserve(v, parts, coptions)

							for _, c in pairs(consts) do
								if c.Attachment then
									c.Constraint.Parent = c.ConstraintParent
									c.Attachment.Parent = c.AttachmentParent
								elseif c.NoCollisionConstraint then
									local ncc = Instance.new("NoCollisionConstraint")
									ncc.Part0 = c.NoCollisionPart0
									ncc.Part1 = c.NoCollisionPart1
									ncc.Parent = c.NoCollisionParent
								elseif c.WeldConstraint then
									local nw = Instance.new("WeldConstraint")
									nw.Part0 = c.WeldConstraintPart0
									nw.Part1 = c.WeldConstraintPart1
									nw.Parent = c.WeldConstraintParent
								end
							end

							v:Destroy()
						end
					end)
				else
					for _, j in pairs(v:GetJoints()) do
						j:Destroy()
					end

					v.Anchored = false

					local bv = Instance.new("BodyVelocity")
					bv.MaxForce = Vector3.one * 10e7
					bv.Velocity = (v.Position - main).Unit * nn(250, 750, true)
					bv.Parent = v

					task.delay(.1, bv.Destroy, bv)
				end
			end
		end

		task.delay(4, mdl.Destroy, mdl)
	end)

	local bone = hum.RootPart:FindFirstChild("Bone.077", true)
	local fx = assets.Effects.Attacks.Hand:Clone()
	local a0 = Instance.new("Attachment", fx)
	local rc = Instance.new("RigidConstraint", fx)
