					task.wait(1 / v.Rate)
				end
			end)
		end
	end

	task.wait(.25)
	yep = false

	create_fx("WorldCuttingThrow", nil, hum.RootPart.CFrame * CFrame.new(0, hum.RootPart.Size.Y * -2.5, -35) * CFrame.Angles(math.pi / 2, 0, 0))
	task.wait(.1)

	create_fx("WorldCuttingWind", nil, hum.RootPart.CFrame * CFrame.new(0, hum.RootPart.Size.Y * -2.5, -5) * CFrame.Angles(math.pi / 2, 0, 0), 3)

	local beams = assets.Effects.Attacks.Beams:Clone()
	beams:ScaleTo(1.3)
	beams:SetPrimaryPartCFrame(hum.RootPart.CFrame * CFrame.new(0, hum.RootPart.Size.Y * -5.5, 0))
	beams.Parent = script
	task.delay(3, beams.Destroy, beams)

	local speeds, trans = {}, {}

	for _, v in pairs(beams:GetDescendants()) do
		if string.match(v.Name, "Far") then
			local old = v.CFrame
			v.CFrame *= CFrame.new(0, 0, 34)
			tw:Create(v, TweenInfo.new(.2, Enum.EasingStyle.Sine), {CFrame = old}):Play()
		elseif v:IsA("Beam") then
			trans[v] = v.Transparency
			speeds[v] = v.TextureSpeed
		end
	end

	local n1 = Instance.new("NumberValue")
	local n2 = Instance.new("NumberValue")

	n1.Changed:Connect(function()
		for i, v in pairs(speeds) do
			i.TextureSpeed = v * n1.Value
		end
	end)

	n2.Changed:Connect(function()
		for i, v in pairs(trans) do
			local kps = v.Keypoints

			for j, w in pairs(kps) do
				kps[j] = NumberSequenceKeypoint.new(w.Time, w.Value * n2.Value)
			end

			i.Transparency = NumberSequence.new(kps)
		end
	end)

	n1.Value = 3.5
	n2.Value = .95
	n1.Parent = script
	n2.Parent = script
	task.delay(3, n1.Destroy, n1)
	task.delay(3, n2.Destroy, n2)

	tw:Create(n2, TweenInfo.new(1.5, Enum.EasingStyle.Sine), {Value = 1.2}):Play()

	task.delay(.1, function()
		tw:Create(n1, TweenInfo.new(.76, Enum.EasingStyle.Sine), {Value = .1}):Play()
	end)

	anims.WorldCuttingSlash.Stopped:Wait()

	change()
	dbs.Stunned = false
	create_cd("WorldSlash")
