local function tryAttack(distance)
	local name = attacknames[Random.new():NextInteger(1, #attacknames)]
	local attack = attacks[name]
	if(attack.Range > distance)then
		if(Random.new():NextInteger(1, attack.Chance) == 1)then
			re:Fire({Action = name})
		else
			tryAttack(distance)
		end
	end
end

while task.wait(.5) do
	if(halted)then continue end	

	local closestRoot, distance = getClosestRoot()
	if(closestRoot)then
		mhit = closestRoot.Position
		tryAttack(distance)
		raga:FindFirstChildOfClass("Humanoid"):MoveTo(closestRoot.Position)
	end
end